function randElem(arr) {
    return arr[Math.floor(Math.random() * arr.length)];
}

function hideUI(ship, id) {
    ship.setUIComponent({
        id: id,
        position: [0, 0, 0, 0],
        visible: false,
        clickable: false
    });
}

function getCrystals (type) {
    let level = Math.trunc(type / 100);
    let crystals;
    if (level == 1 && type != 121) {
        crystals = 220;
    }
    else if (level == 2) {
        crystals = 420;
    }
    else {
        crystals = ((Math.pow((level || 0), 2)) * 20) / 2;
    }
    return crystals;
};

function formatTime(time) {
    let minutes = 0;
    let seconds = Math.floor(time / 60);
    minutes = Math.floor(seconds / 60);
    seconds %= 60;
    return `${minutes}:${seconds < 10 ? 0 : ''}${seconds}`;
}

function getDistance(x1, y1, x2, y2) {
    return Math.sqrt(Math.pow(x1 - x2, 2) + Math.pow(y1 - y2, 2));
}

function deepCopy(object) {
    return JSON.parse(JSON.stringify(object));
}

function getRadarPosition(x, y, size) {
    return [
        RADAR_TRANSLATE + x * RADAR_SCALE_POS - size * RADAR_SCALE_SIZE,
        RADAR_TRANSLATE - y * RADAR_SCALE_POS - size * RADAR_SCALE_SIZE,
        size,
        size
    ]
}

