this.tick = function() {
    if (game.step % ROUND_TIME == 0) {
        setRoundDefault();
        resetFlag();
    }
    if (game.step % GAME_STEP == 0 && game.ships.length > 0) {
        game.custom.roundTime -= GAME_STEP;
        game.custom.flag.expiry -= GAME_STEP;
        updatePlayers();
        updateScoreboard();
        setFlagStatus();
        setPortalStatus();
        maintainAliens();
    }
}

this.event = function(event) {
    let ship = event.ship;
    switch(event.name) {
        case 'ship_spawned':
            spawnShip(ship);
            break;
        case 'ship_destroyed':
            if (ship.custom.hasFlag) {
                dropFlag(ship);
            }
            break;
    }
}
